import React from "react";

const recommendUserInfo = [
  {
    id: 1,
    name: "joaaaaaahye",
    know: "_legend_a님 외 2명이 ...",
    src: "data:image/jpeg;base64,",
    alt: "user1",
  },
  {
    id: 2,
    name: "rampart81",
    know: "ringo.in.seoul님 외 12...",
    src: "data:image/jpeg;base64,",
    alt: "user2",
  },
  {
    id: 3,
    name: "shawnjjoo",
    know: "jimmylee1220님 외 1...",
    src: "data:image/jpeg;base64,",
    alt: "user3",
  },
];

const RecommendUser = () => {
  return (
    <div className="recommendUser">
      <div className="userProfile">
        <div className="recommendUserDescription">
          {recommendUserInfo.map((el) => (
            <div className="storyUserContent">
              <img src={el.src} alt={el.alt} />
              <div className="">
                <p>{el.name}</p>
                <p>{el.know}</p>
              </div>
              <button>팔로우</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default RecommendUser;
